import {all,fork,take,takeEvery,takeLatest,put,delay} from "redux-saga/effects"
import axios from "axios"

export default function* rootSaga(){
    yield all([
        fork(watchLogIn),
        fork(watchLogOut),
        fork(watchAddPost),
    ]);
}
